import React, { useState } from 'react';
import './ResetAppointmentPage.css';

function ResetAppointmentPage() {
  // Các state và các hàm xử lý sự kiện giữ nguyên

  return (
    <div className="reset-appointment-page">
      <h2>Đặt lại lịch tái khám</h2>

      {errorMessage && <p className="error-message">{errorMessage}</p>}
      {successMessage && <p className="success-message">{successMessage}</p>}

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name">Họ và tên:</label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={handleNameChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={handleEmailChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="appointmentDate">Ngày tái khám:</label>
          <input
            type="date"
            id="appointmentDate"
            value={appointmentDate}
            onChange={handleAppointmentDateChange}
          />
        </div>
        <button type="submit">Đặt lại lịch tái khám</button>
      </form>
    </div>
  );
}

export default ResetAppointmentPage;
